// ImageLogo.js
import React from 'react';
import logoImage from './styles/STudy.png';

function ImageLogo() {
  return (
// Check the case of the filename and folder
  <img src={logoImage} alt="Logo" width={120} height={120} />
  );
}

export { ImageLogo};
